import React from 'react'
let HeadStyles = {
  div: {
    backgroundColor: 'gold',
    height: '60px',
    textAlign: 'center',
    paddingTop: 40,
  },
  span: {
    fontSize: 25,
    fontWeight: 'bold',
  },
}
export const Head = () => {
  return (
    <div style={HeadStyles.div}>
      <span>
        <link to="/CreatePost">Create Post</link>
      </span>
      <span style={HeadStyles.span}>Welcome To Application</span>
    </div>
  )
}
